import axios from "axios"

export const getHistory=()=>(dispatch)=>{
    axios.get('http://localhost:8182/customerBook/customerid/15')
    .then(response=>{
        //give the response to the reducer
        dispatch({
            type:'GET_LIST',
            payload:response.data
        })
        // return{
        //     type:'GET_LIST',
        //     payload: response.data
        // }
    })
}
